    "42cf8112-0f38-4c9f-90b6-c445f363ff2f": {"id":"42cf8112-0f38-4c9f-90b6-c445f363ff2f","project_id":14263,"key":36576407,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.534Z","updated_at":"2022-09-26T00:08:04.534Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eXin could have spotted that she was being scammed with a targeted whaling attack by checking more carefully on who sent the email.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eOn many laptops and desktops your inbox won’t show the full sender’s address. You may only see the friendly ‘display name’ of a sender and these can look legitimate even when the address is not. Here’s one way to check the full address…\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
