    "015714ee-b0ab-4aea-a099-0305a6374b04": {"id":"015714ee-b0ab-4aea-a099-0305a6374b04","project_id":14263,"key":36576391,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.443Z","updated_at":"2022-09-26T00:08:04.443Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eXin had a link in her whaling email that redirected her to a fraudulent site. \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eWatch out for hyperlinks and ‘go to’ buttons.  If the link looks dodgy and doesn’t match the sender’s URL then beware.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eOn laptops/desktops you can hover over buttons and links to see the actual embedded link. \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eOn mobile devices you can’t hover but you can press and hold a link and this will show you the real embedded address.\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
    "a2f329a3-e009-4eb8-a7bc-78672f0f3326": {"id":"a2f329a3-e009-4eb8-a7bc-78672f0f3326","project_id":14263,"key":36576390,"version":null,"meta":{"subType":"continue"},"children":null,"deleted_at":null,"created_at":"2022-09-26T00:08:04.438Z","updated_at":"2022-09-26T00:08:04.438Z","props":{"label":"Continue","background":"#87189d","borderWidth":1,"shape":"pill","font":"","location":"next","localBackgroundColor":true},"type":"ContinueButton"}, 
