    "fc74eea6-f4f3-4fa7-b5f0-858e7f992385": {"id":"fc74eea6-f4f3-4fa7-b5f0-858e7f992385","project_id":14263,"key":36576388,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.428Z","updated_at":"2022-09-26T00:08:04.428Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – identify it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eScammers can also cause a world of pain by getting you to open attachments to emails. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnce opened these can introduce malware onto your system. Some examples can steal information, others can lock you out of files so that you need to pay a ransom to regain access.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnly ever open attachments from trusted senders.\u003c/p\u003e"},"type":"Text"}, 
    "a687ff73-2856-4aad-be0e-d1843274893e": {"id":"a687ff73-2856-4aad-be0e-d1843274893e","project_id":14263,"key":36576387,"version":null,"meta":{"subType":"continue"},"children":null,"deleted_at":null,"created_at":"2022-09-26T00:08:04.421Z","updated_at":"2022-09-26T00:08:04.421Z","props":{"label":"Continue","background":"#87189d","borderWidth":1,"shape":"pill","font":"","location":"next","localBackgroundColor":true,"color":"#ffffff","localColor":true,"borderColor":"#87189d"},"type":"ContinueButton"}, 
    "88e3f3c3-3260-4a67-a7cc-e00170b43563": {"id":"88e3f3c3-3260-4a67-a7cc-e00170b43563","project_id":14263,"key":36576386,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.416Z","updated_at":"2022-09-26T00:08:04.416Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts her good friends but she has accepted a few ‘friend requests’ from people she hardly knows. Some of these folks enjoy re-posting her messages to others she doesn’t know at all.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
