    "97e4d0af-f7c2-4365-928a-c72fc7b64612": {"id":"97e4d0af-f7c2-4365-928a-c72fc7b64612","project_id":14263,"key":36576384,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.405Z","updated_at":"2022-09-26T00:08:04.405Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts her good friends but she has accepted a few ‘friend requests’ from people she hardly knows. Some of these folks enjoy re-posting her messages to others she doesn’t know at all.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
    "02c6ba15-cee5-48ba-9415-773a6f01769a": {"id":"02c6ba15-cee5-48ba-9415-773a6f01769a","project_id":14263,"key":36576383,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.399Z","updated_at":"2022-09-26T00:08:04.399Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a laptop/desktop she can check the real address by right-clicking or hovering on the display name for more information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a mobile device she can also find out the full sender’s address by selecting the email and then selecting the display name to see the full address. Depending on your device and set-up there may be other ways you can check – practise on your devices after completing this.\u003c/p\u003e"},"type":"Text"}, 
    "7bde91d6-c5ba-4427-9bad-f1a642dc58ab": {"id":"7bde91d6-c5ba-4427-9bad-f1a642dc58ab","project_id":14263,"key":36576382,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.394Z","updated_at":"2022-09-26T00:08:04.394Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eFake domains\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eLook particularly for what comes at the end of the domain name – on the right-hand side of the address. Does this part of the address match with the organisation? This example clearly isn’t from Microsoft.\u003c/p\u003e"},"type":"Text"}, 
