    "b8b12de1-ef10-47ed-9ecd-00714babb7e9": {"id":"b8b12de1-ef10-47ed-9ecd-00714babb7e9","project_id":14263,"key":36576365,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.294Z","updated_at":"2022-09-26T00:08:04.294Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts her good friends but she has accepted a few ‘friend requests’ from people she hardly knows. Some of these folks enjoy re-posting her messages to others she doesn’t know at all.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
    "bffb0d47-91e2-4542-94cd-7657ce46837f": {"id":"bffb0d47-91e2-4542-94cd-7657ce46837f","project_id":14263,"key":36576364,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.288Z","updated_at":"2022-09-26T00:08:04.288Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a laptop/desktop she can check the real address by right-clicking or hovering on the display name for more information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a mobile device she can also find out the full sender’s address by selecting the email and then selecting the display name to see the full address. Depending on your device and set-up there may be other ways you can check – practise on your devices after completing this.\u003c/p\u003e"},"type":"Text"}, 
    "8d066d71-b2c2-4142-bc66-badfc6c9b926": {"id":"8d066d71-b2c2-4142-bc66-badfc6c9b926","project_id":14263,"key":36576363,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.282Z","updated_at":"2022-09-26T00:08:04.282Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a laptop/desktop she can check the real address by right-clicking or hovering on the display name for more information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a mobile device she can also find out the full sender’s address by selecting the email and then selecting the display name to see the full address. Depending on your device and set-up there may be other ways you can check – practise on your devices after completing this.\u003c/p\u003e"},"type":"Text"}, 
