    "cbf54e0d-a302-418e-9505-caae33037f62": {"id":"cbf54e0d-a302-418e-9505-caae33037f62","project_id":14263,"key":36576350,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:04.204Z","updated_at":"2022-09-26T00:08:04.204Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eSometimes hackers attack just one individual or organisation. They will research them and send them a ‘spoofed’ email that pretends to be from a person or organisation they know or deal with. A victim may be more tempted to click on a suspicious link within the email as it’s relevant to them. This is ‘spear phishing’.\u003c/p\u003e"},"type":"Text"}, 
