    "443a7a28-4046-4d7c-82eb-6a9c37e8974a": {"id":"443a7a28-4046-4d7c-82eb-6a9c37e8974a","project_id":14263,"key":36576243,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.567Z","updated_at":"2022-09-26T00:08:03.567Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eAsking for personal information \u003c/p\u003e"},"type":"Text"}, 
    "9f8ae8a9-518d-442a-9d4f-88a4e0a11d25": {"id":"9f8ae8a9-518d-442a-9d4f-88a4e0a11d25","project_id":14263,"key":36576242,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.562Z","updated_at":"2022-09-26T00:08:03.562Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eSomething you didn’t do\u003c/p\u003e"},"type":"Text"}, 
    "9cec4b8b-9943-453d-86d1-772aeb3bea51": {"id":"9cec4b8b-9943-453d-86d1-772aeb3bea51","project_id":14263,"key":36576241,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.557Z","updated_at":"2022-09-26T00:08:03.557Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eHackers can try to pressure you into clicking a link by emphasising that action is urgent. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e“Act now so you don’t miss out/pay the fine/lose your chance!”. Being rushed is a good clue you’re probably being attacked.\u003c/p\u003e"},"type":"Text"}, 
    "a630c323-fa9b-49f2-9d62-9a5039e4dccb": {"id":"a630c323-fa9b-49f2-9d62-9a5039e4dccb","project_id":14263,"key":36576240,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.552Z","updated_at":"2022-09-26T00:08:03.552Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eWe are all curious creatures and naturally drawn to things that give us rewards or spark our interest. Hackers who have specifically addressed you could know about your interests and concerns. They’ll use this information to target an email at what interests you.\u003c/p\u003e"},"type":"Text"}, 
    "7ba81e76-c95b-4cf0-9d26-88ac24b5decc": {"id":"7ba81e76-c95b-4cf0-9d26-88ac24b5decc","project_id":14263,"key":36576239,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.547Z","updated_at":"2022-09-26T00:08:03.547Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eHackers love to trick people into thinking that a message is from an institution with authority. These often make you fearful by telling you to pay a fine or act now to avoid some other fake punishment.\u003c/p\u003e"},"type":"Text"}, 
    "dbc46aef-be68-46c4-bfe9-665264690e36": {"id":"dbc46aef-be68-46c4-bfe9-665264690e36","project_id":14263,"key":36576238,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:03.542Z","updated_at":"2022-09-26T00:08:03.542Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eBanks will never ask you to send them your PIN, password or account details. Similarly, a reputable company should never send an email asking for your password, credit card number, or the answer to a security question. \u003c/p\u003e"},"type":"Text"}, 
