    "67520a88-787c-4413-b723-0aa09057d499": {"id":"67520a88-787c-4413-b723-0aa09057d499","project_id":14263,"key":36575957,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:01.898Z","updated_at":"2022-09-26T00:08:01.898Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnly the Microsoft OneDrive address was legitimate. She reported the rest using the ‘Report Spam’ or \u0026#x27;Report Message\u0026#x27; button. Remember to look at the end of the domain name – the right hand side of the address. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eDoes this part of the address… \u003c/p\u003e\u003cul data-type=\"bulleted-list\"\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003ematch with the organisation \u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003ehave any spelling mistakes contain \u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003erandom numbers and letters \u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003euse a gmail, yahoo etc domain?\u003c/li\u003e\u003c/ul\u003e"},"type":"Text"}, 
