    "25f59aee-677b-4fdb-825b-e3b9fcf1b287": {"id":"25f59aee-677b-4fdb-825b-e3b9fcf1b287","project_id":14263,"key":36575953,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:01.877Z","updated_at":"2022-09-26T00:08:01.877Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ or \u0026#x27;Report Message\u0026#x27; button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
    "8e1364fa-38e4-4301-94cc-ea85731ea05a": {"id":"8e1364fa-38e4-4301-94cc-ea85731ea05a","project_id":14263,"key":36575952,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:01.872Z","updated_at":"2022-09-26T00:08:01.872Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ or \u0026#x27;Report Message\u0026#x27; button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
    "8fc97f44-f7a2-43a7-a8fe-bdc23db33bab": {"id":"8fc97f44-f7a2-43a7-a8fe-bdc23db33bab","project_id":14263,"key":36575951,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:01.867Z","updated_at":"2022-09-26T00:08:01.867Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts good friends but her privacy settings allow others to see more than she was aware of. Some of these folks can see her posts, photos and even date of birth.  \u003cbr/\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
    "fdf21196-6ae2-4dba-8038-0c82286aa289": {"id":"fdf21196-6ae2-4dba-8038-0c82286aa289","project_id":14263,"key":36575950,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:08:01.862Z","updated_at":"2022-09-26T00:08:01.862Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJen’s free to use social media as she wants. However, she needs to watch what kind of information she’s putting out publicly. She trusts good friends but her privacy settings allow others to see more than she was aware of. Some of these folks can see her posts, photos and even date of birth.  \u003cbr/\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHarry, a friend of a friend of a friend, sees what she’ll be doing next week…\u003c/p\u003e"},"type":"Text"}, 
